        this.mProcs = new TestProcDescription[1024];
        this.initClass0 ();
        this.initClass1 ();
        this.initClass2 ();
        this.initClass3 ();
        this.initClass4 ();
        this.initClass5 ();
        this.initClass6 ();
        this.initClass7 ();
        this.initClass8 ();
        this.initClass9 ();
