    private class TestProcDescription
    {
        TestProcDescription (String name, String ... parameters)
        {
            this.name       = name;
            this.parameters = parameters;
        }

        String getName ()
        {
            return this.name;
        }

        String getParameter (int i )
        {
            return this.parameters[i];
        }

        int getParamsCount ()
        {
            return this.parameters.length;
        }

        private final String    name;
        private final String[]  parameters;
    }

    public static void main (String[] args) throws IOException
    {
        String[]  customArgs = { "--root", "-d", "test_list_db_frame_size", "--fs", "32768" };
        final int customCount = customArgs.length;
        customArgs = Arrays.copyOf(customArgs, customCount + args.length);
        for (int i = 0; i < args.length; ++i)
            customArgs[customCount + i] = args[i];

        CommnandLine cmdLine = new CommnandLine (customArgs);
        Connection c = new Connection (cmdLine.getHostname (),
                                       cmdLine.getPort (),
                                       cmdLine.getDatabase (),
                                       cmdLine.getPassword (),
                                       (byte) cmdLine.getUserId (),
                                       cmdLine.getMaxFrameSize ());

        ConnectorTestListProcs testListGlobas = new ConnectorTestListProcs ();

        boolean testResult = testListGlobas.checkProceduresNames (c);
        testResult = testResult && testListGlobas.checkProceduresParamters (c);

        c.close ();

        if ( ! testResult) {
            System.out.println ("TEST RESULT: FAIL");
            System.exit (1);
        }

        System.out.println ("TEST RESULT: PASS");
    }

    boolean checkProceduresNames (Connection c) throws IOException
    {
        final String[] procedures = c.retrieveProceduresNames ();

        for (int i = 0; i < procedures.length; ++i) {
            for (int j = i + 1; j < procedures.length; ++j) {
                if (procedures[i].equals (procedures[j])) {
                    System.out.println ("Retieved a procedure name twice.");
                    return false;
                }
            }

            int found = -1;
            for (int j = 0; j < this.mProcs.length; ++j) {
                if (procedures[i].equals (this.mProcs[j].getName ())) {
                    found = j;
                    break;
                }
            }

            if (found < 0) {
                System.out.println ("Retrieved an unepxected procedure name '" + procedures[i] + "'.");
                return false;
            }
        }

        return true;
    }

    boolean checkProceduresParamters (Connection c) throws IOException
    {
        for (int proc = 0; proc < this.mProcs.length; ++proc) {
            ProcedureDescription params = c.describeProcedure (this.mProcs[proc].getName ());

            if (params.getParametersCount () != this.mProcs[proc].getParamsCount() - 1) {
                System.out.println ("The patameters count for procedure '" + this.mProcs[proc].getName () + "' does not match (" +
                                    params.getParametersCount () + " vs. " + this.mProcs[proc].getParamsCount() + ")");
                return false;
            }

            for (int p = 0; p < params.getParametersCount () + 1; ++p) {

                ValueType valType = null;

                if (p == 0)
                    valType = params.describeReturnValue ();
                else
                    valType = params.describeParameter(p - 1);

                String type = valType.toString ();
                String validType = this.mProcs[proc].getParameter(p);

                if (! valType.isTable ()
                    || (valType.getFields ().length == 0))
                {
                    if ( ! type.equals (validType)){
                        System.out.println ("The parameter " + p + " type of the procedure '" + this.mProcs[proc].getName () +
                                "' does not match:\n" +
                                type + "\tvs.\n" + this.mProcs[proc].getParameter(p + 1));
                        return false;
                    }
                }
                else
                {
                    TableFieldType[] fields = valType.getFields ();

                    for (int i = 0; i < fields.length; ++ i)
                    {
                        for (int j = i + 1; j < fields.length; ++j)
                        {
                            if (fields[i].getName().equals(fields[j].getName()))
                            {
                                System.out.println ("The parameter " + p + " type of the procedure '" + this.mProcs[proc].getName () +
                                                    "' has two fields named '" + fields[i].getName() + "'.");
                                return false;
                            }
                        }
                    }

                    for (TableFieldType f : fields)
                    {
                        if (validType.indexOf (f.toString ()) < 0)
                        {
                            System.out.println ("The parameter " + p + " type of the procedure '" + this.mProcs[proc].getName () +
                                                "' has no field like '" + f.toString() + "' in\n" + validType);
                            return false;
                        }
                    }
                }
            }
        }
        return true;
    }

